import React from 'react'

const styles={
    width: 100,
    height: 40,
    backgroundImage: linearGradient('#00A8B0', '#78BE20'),
}

export default function VerifiedLabel() {
    return (
        <div>
            <span style={{styles}}>Verified</span>
        </div>
    )
}
